        var valid = validaDatos('MenuModal');
        if (!valid.isError) {

            var activo = false;
            if ($('#Menu_Activo').prop('checked')) {
                activo = true;
            }

            var borrado = false;
            if ($('#Menu_Borrado').prop('checked')) {
                borrado = true;
            }

            var model = {
                ""Id"": $('#Menu_Id').val(),
